class Solution(object):
	def numDecodings(self, s):
		"""
		:type s: str
		:rtype: int
		"""
		l = len(s)
		if l ==0:
			return 0
		dp = [0]*l
		i = l-1
		while i>=0:
			prev = dp[i+1] if i+1 <l else 1
			prevprev = dp[i+2] if i+2 <l else 1
			combineprevnum = int(s[i]+s[i+1]) if i+1<l else 0
			num = int(s[i])
			dp[i] = prev + prevprev if combineprevnum <=26 and combineprevnum>=10 else prev
			if num ==0:
				dp[i] = 0
			i-=1 
		return dp[0]
